  <script>




    function openModal(event, modalId) {
      var modal = document.getElementById(modalId);
      modal.style.display = "block";
    }

    function closeModal(modalId) {
      var modal = document.getElementById(modalId);
      modal.style.display = "none";
    }

    var modals = document.getElementsByClassName("modal");
    var spans = document.getElementsByClassName("close");

    for (var i = 0; i < spans.length; i++) {
      spans[i].onclick = function() {
        var modalId = this.parentNode.parentNode.parentNode.id;
        closeModal(modalId);
      };
    }

    window.onclick = function(event) {
      for (var i = 0; i < modals.length; i++) {
        if (event.target == modals[i]) {
          closeModal(modals[i].id);
        }
      }
    };

    document.addEventListener('DOMContentLoaded', (event) => {

  function estSurvolé(selector) {
    return Array.from(document.querySelectorAll(selector)).some(el => el.matches(':hover'));
  }

  function changerCouleurLieu(lieuSelector, rueSelector, hover) {
    var couleurLieu = hover ? '#96CD32' : '#1423DC';
    var couleurRue = hover ? '#83B822' : '#232873';

    document.querySelectorAll(lieuSelector).forEach(function(lieu) {
      lieu.style.fill = couleurLieu;
      lieu.style.cursor = hover ? 'pointer' : '';
    });
    document.querySelectorAll(rueSelector).forEach(function(rue) {
      rue.style.fill = couleurRue;
      rue.style.cursor = hover ? 'pointer' : '';
    });
  }

  function attacherEvenementsLieu(lieuSelector, rueSelector, url) {
    document.querySelectorAll(lieuSelector).forEach(function(lieu) {
      lieu.addEventListener('mouseover', function() {
        changerCouleurLieu(lieuSelector, rueSelector, true);
      });
      lieu.addEventListener('mouseout', function() {
        if (!estSurvolé(rueSelector)) {
          changerCouleurLieu(lieuSelector, rueSelector, false);
        }
      });
      lieu.addEventListener('click', function() {
        window.location.href = url;
      });
    });

    document.querySelectorAll(rueSelector).forEach(function(rue) {
      rue.addEventListener('mouseover', function() {
        changerCouleurLieu(lieuSelector, rueSelector, true);
      });
      rue.addEventListener('mouseout', function() {
        if (!estSurvolé(lieuSelector)) {
          changerCouleurLieu(lieuSelector, rueSelector, false);
        }
      });
      rue.addEventListener('click', function() {
        window.location.href = url;
      });
    });
  }

  var lieux = [
    { lieu: '.grenelle', rue: '.grenelle_rues', url: '../agences_dr_paris/page_agences.php?nomAgence=Grenelle' },
    // { lieu: '.equation', rue: '.equation_rues', url: '../agences_dr_paris/page_agences.php?nomAgence=Equation' },
    { lieu: '.batignolles', rue: '.batignolles_rues', url: '../agences_dr_paris/page_agences.php?nomAgence=Batignolles' },
    { lieu: '.italie', rue: '.italie_rues', url: '../agences_dr_paris/page_agences.php?nomAgence=Italie' },
    // { lieu: '.saint_maur', rue: '.saint_maur_rues', url: '../agences_dr_paris/page_agences.php?nomAgence=Saint-Maur' }
  ];

  lieux.forEach(function(lieu) {
    attacherEvenementsLieu(lieu.lieu, lieu.rue, lieu.url);
  });

  });



  </script>
